import React, { Fragment } from "react";

// import styles
import s from "../../styles/navbar.module.css";

// import component
import CustomDropDown from "../../components/UI/DropDown";
import { UserDropDownOption } from "../../utils/constants";

const NavBar = () => {
  return (
    <Fragment>
      <div className={s.Navbar}>
        <div className={s.LogoContainer}>
          <div className={s.logo}>
            <a href="#home" class={s.navbarBrand}>
              Sharp<span>Minor</span>
            </a>
          </div>
        </div>
        <div className={s.headerRightContent}>
          <div className={s.userDropdown}>
            <div className={s.userImg}>
              <img
                src="../../static/assets/imgs/placeholder.png"
                alt="user-img"
                className="user-fluid"
                width="40"
              />
            </div>
            <div className={s.userName}>
              <p>Christeen Lee</p>
              <span>SID - 54689</span>
            </div>
            <CustomDropDown List={UserDropDownOption} />
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default NavBar;
